  import React from 'react';
  import { FaBars, FaFacebook, FaInstagram, FaInstagramSquare } from 'react-icons/fa';


const Home = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Home</h1>
      <FaInstagramSquare />
    </div>
  );
};

export default Home;
